// SPDX-License-Identifier: MIT
pragma solidity ^0.8.30;

/// @notice Interfaz mínima para tokens ERC-20, porque en Ethereum no confiamos en promesas sin contratos
interface IERC20 {
    function totalSupply() external view returns (uint256);          // Cantidad total de tokens en circulación
    function balanceOf(address account) external view returns (uint256);  // Balance de tokens de una cuenta
    function transfer(address recipient, uint256 amount) external returns (bool); // Transferir tokens a alguien
    function allowance(address owner, address spender) external view returns (uint256); // Cuánto puede gastar otro
    function approve(address spender, uint256 amount) external returns (bool);  // Autorizar gasto a otro
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool); // Transferencia autorizada
}

/// @notice Librería matemática para cálculos comunes (aquí solo la raíz cuadrada, porque no todos somos Einstein)
library Math {
    /// @notice Calcula la raíz cuadrada entera usando el método de aproximación de Babylon
    /// @param y El número para calcular la raíz cuadrada
    /// @return z La raíz cuadrada entera de y
    function sqrt(uint y) internal pure returns (uint z) {
        if (y > 3) {
            z = y;
            uint x = y / 2 + 1;
            while (x < z) {
                z = x;
                x = (y / x + x) / 2;
            }
        } else if (y != 0) {
            z = 1; // Raíz cuadrada de 1, 2 o 3 se aproxima a 1 para simplicidad
        }
    }
}

/// @notice Interfaz para el token LP que usamos para representar participación en el pool
interface ILPToken {
    function mint(address to, uint256 amount) external;  // Crear tokens LP nuevos para un proveedor
    function burn(address from, uint256 amount) external; // Quemar tokens LP al retirar liquidez
    function balanceOf(address account) external view returns (uint256); // Balance de tokens LP
    function totalSupply() external view returns (uint256); // Total de tokens LP existentes
}

/// @title SimpleSwap - Protocolo básico para intercambio y provisión de liquidez entre dos tokens ERC-20
contract SimpleSwap {
    using Math for uint256; // Habilita la función sqrt sobre uint256 para cálculos elegantes

    address public immutable tokenA;  // Dirección del token A del par
    address public immutable tokenB;  // Dirección del token B del par
    address public owner;              // Dueño del contrato (por si hay que hacer magia administrativa)

    ILPToken public lpToken;           // Token LP que representa la participación en el pool

    uint public reserveA;              // Reserva actual de token A en el pool
    uint public reserveB;              // Reserva actual de token B en el pool

    // Eventos para registrar adiciones y retiros de liquidez, importantes para la transparencia y el análisis
    event LiquidityAdded(address indexed provider, uint amountA, uint amountB, uint liquidity);
    event LiquidityRemoved(address indexed provider, uint amountA, uint amountB, uint liquidity);

    /// @notice Constructor para inicializar el par de tokens y el token LP asociado
    /// @param _tokenA Dirección del token A
    /// @param _tokenB Dirección del token B
    /// @param _lpToken Dirección del contrato del token LP ya desplegado
    constructor(address _tokenA, address _tokenB, address _lpToken) {
        require(_tokenA != _tokenB, "Tokens must be different"); // No se aceptan pares de tokens idénticos, eso sería aburrido
        tokenA = _tokenA;
        tokenB = _tokenB;
        owner = msg.sender;
        lpToken = ILPToken(_lpToken);
    }

    /// @notice Agrega liquidez al pool, calculando cantidades óptimas y minimas aceptables
    /// @param amountADesired Cantidad deseada de token A para depositar
    /// @param amountBDesired Cantidad deseada de token B para depositar
    /// @param amountAMin Cantidad mínima de token A que el proveedor está dispuesto a depositar (slippage control)
    /// @param amountBMin Cantidad mínima de token B que el proveedor está dispuesto a depositar
    /// @param to Dirección que recibirá los tokens LP
    /// @param deadline Fecha límite para que la transacción se ejecute (protección contra demoras)
    /// @return amountA Cantidad final de token A depositada
    /// @return amountB Cantidad final de token B depositada
    /// @return liquidityMinted Cantidad de tokens LP emitidos al proveedor
    function addLiquidity(
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) external returns (uint amountA, uint amountB, uint liquidityMinted) {
        require(block.timestamp <= deadline, "Transaction expired"); // No nos gusta procesar órdenes antiguas
        require(to != address(0), "Invalid recipient"); // No se puede mandar tokens al limbo

        if (reserveA == 0 && reserveB == 0) {
            // Si es la primera liquidez, acepta lo que venga sin condiciones
            amountA = amountADesired;
            amountB = amountBDesired;
        } else {
            // Calcula la cantidad óptima de token B para mantener proporciones y evitar arbitraje
            uint amountBOptimal = (amountADesired * reserveB) / reserveA;
            if (amountBOptimal <= amountBDesired) {
                require(amountBOptimal >= amountBMin, "Slippage: B too low"); // Protección anti-slippage
                amountA = amountADesired;
                amountB = amountBOptimal;
            } else {
                // Si la cantidad óptima de B es mayor que la deseada, recalcula A óptimo
                uint amountAOptimal = (amountBDesired * reserveA) / reserveB;
                require(amountAOptimal >= amountAMin, "Slippage: A too low");
                amountA = amountAOptimal;
                amountB = amountBDesired;
            }
        }

        // Transferir los tokens desde el proveedor al contrato
        require(IERC20(tokenA).transferFrom(msg.sender, address(this), amountA), "Transfer tokenA failed");
        require(IERC20(tokenB).transferFrom(msg.sender, address(this), amountB), "Transfer tokenB failed");

        // Actualizar reservas internas con los nuevos depósitos
        reserveA += amountA;
        reserveB += amountB;

        // Calcular liquidez como raíz cuadrada del producto de tokens depositados (estándar Uniswap-style)
        liquidityMinted = Math.sqrt(amountA * amountB);

        // Mint tokens LP para el proveedor, representando su participación
        lpToken.mint(to, liquidityMinted);

        // Emitir evento para trazabilidad
        emit LiquidityAdded(to, amountA, amountB, liquidityMinted);
    }

    /// @notice Remueve liquidez quemando tokens LP y devolviendo proporción de reservas
    /// @param liquidityAmount Cantidad de tokens LP a quemar
    /// @param amountAMin Cantidad mínima de token A que se quiere recibir
    /// @param amountBMin Cantidad mínima de token B que se quiere recibir
    /// @param to Dirección que recibirá los tokens
    /// @param deadline Fecha límite para la operación
    /// @return amountA Cantidad de token A devuelta
    /// @return amountB Cantidad de token B devuelta
    function removeLiquidity(
        uint liquidityAmount,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) external returns (uint amountA, uint amountB) {
        require(block.timestamp <= deadline, "Transaction expired");
        require(to != address(0), "Invalid recipient");
        require(lpToken.balanceOf(msg.sender) >= liquidityAmount, "Not enough liquidity");

        // Obtiene la cantidad total de tokens LP emitidos (liquidez total)
        uint totalLiq = lpToken.totalSupply();
        require(totalLiq > 0, "No liquidity");

        // Calcula las cantidades de tokens a devolver según la participación proporcional
        amountA = (liquidityAmount * reserveA) / totalLiq;
        amountB = (liquidityAmount * reserveB) / totalLiq;

        // Protección contra slippage para evitar recibir menos tokens de los esperados
        require(amountA >= amountAMin, "Slippage: A too low");
        require(amountB >= amountBMin, "Slippage: B too low");

        // Actualiza las reservas del pool
        reserveA -= amountA;
        reserveB -= amountB;

        // Quemar tokens LP del proveedor
        lpToken.burn(msg.sender, liquidityAmount);

        // Transferir los tokens correspondientes al proveedor
        require(IERC20(tokenA).transfer(to, amountA), "Transfer tokenA failed");
        require(IERC20(tokenB).transfer(to, amountB), "Transfer tokenB failed");

        // Emitir evento para trazabilidad
        emit LiquidityRemoved(to, amountA, amountB, liquidityAmount);
    }

    /// @notice Intercambia una cantidad exacta de tokens por el otro token del par
    /// @param amountIn Cantidad de tokens de entrada a intercambiar
    /// @param amountOutMin Cantidad mínima de tokens de salida esperada
    /// @param path Array con dos direcciones: token de entrada y token de salida
    /// @param to Dirección que recibirá los tokens de salida
    /// @param deadline Fecha límite para la operación
    /// @return amounts Array con cantidad de tokens de entrada y salida efectivamente usados
    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external returns (uint[] memory amounts) {
        require(block.timestamp <= deadline, "Transaction expired");
        require(path.length == 2, "Only direct token swaps supported");

        address input = path[0];
        address output = path[1];
        require((input == tokenA && output == tokenB) || (input == tokenB && output == tokenA), "Invalid token path");

        // Transferir tokens de entrada desde el usuario al contrato
        require(IERC20(input).transferFrom(msg.sender, address(this), amountIn), "TransferFrom failed");

        // Aplicar comisión del 0.3% (997/1000)
        uint amountInWithFee = amountIn * 997;
        uint numerator;
        uint denominator;
        uint amountOut;

        if (input == tokenA) {
            numerator = amountInWithFee * reserveB;
            denominator = reserveA * 1000 + amountInWithFee;
            amountOut = numerator / denominator;
            require(amountOut >= amountOutMin, "Insufficient output");
            reserveA += amountIn;   // Se suma la entrada a la reserva A
            reserveB -= amountOut;  // Se resta la salida de la reserva B
        } else {
            numerator = amountInWithFee * reserveA;
            denominator = reserveB * 1000 + amountInWithFee;
            amountOut = numerator / denominator;
            require(amountOut >= amountOutMin, "Insufficient output");
            reserveB += amountIn;   // Se suma la entrada a la reserva B
            reserveA -= amountOut;  // Se resta la salida de la reserva A
        }

        // Transferir tokens de salida al receptor
        require(IERC20(output).transfer(to, amountOut), "Transfer output failed");

        // Preparar el arreglo de salida con input y output
        amounts = new uint [](2) ;
        amounts[0] = amountIn;
        amounts[1] = amountOut;
    }

    /// @notice Obtiene el precio del token base en términos del token cotizado (scaled by 1e18 para precisión)
    /// @param base Token base
    /// @param quote Token cotizado
    /// @return price Precio calculado
    function getPrice(address base, address quote) external view returns (uint price) {
        require(base != quote, "Tokens must differ");
        require(base != address(0) && quote != address(0), "Invalid address");

        // Obtiene balances actuales del pool para ambos tokens
        uint rA = IERC20(base).balanceOf(address(this));
        uint rB = IERC20(quote).balanceOf(address(this));

        require(rA > 0 && rB > 0, "No liquidity");

        // Calcula precio escalado para evitar floats (a.k.a. magia fija de precisión)
        price = (rB * 1e18) / rA;
    }

    /// @notice Calcula la cantidad de tokens de salida para una cantidad dada de tokens de entrada según fórmula constante
    /// @param tokenIn Token que entra en el swap
    /// @param tokenOut Token que se desea obtener
    /// @param amountIn Cantidad de tokenIn que se provee
    /// @return amountOut Cantidad estimada de tokenOut que se recibirá
    function getAmountOut(address tokenIn, address tokenOut, uint amountIn) external view returns (uint amountOut) {
        require(amountIn > 0, "Invalid input");
        require(
            (tokenIn == tokenA && tokenOut == tokenB) || (tokenIn == tokenB && tokenOut == tokenA),
            "Invalid tokens"
        );

        // Obtener reservas correspondientes al tokenIn y tokenOut
        uint reserveIn = (tokenIn == tokenA) ? reserveA : reserveB;
        uint reserveOut = (tokenOut == tokenA) ? reserveA : reserveB;

        require(reserveIn > 0 && reserveOut > 0, "No liquidity");

        // Aplicar la comisión del 0.3%
        uint amountInWithFee = amountIn * 997;

        // Fórmula clásica Uniswap para calcular salida esperada
        amountOut = (amountInWithFee * reserveOut) / (reserveIn * 1000 + amountInWithFee);
    }

    /// @notice Calcula la liquidez total disponible como la raíz cuadrada del producto de reservas
    /// @return total Liquidez total calculada
    function totalLiquidity() public view returns (uint total) {
        total = Math.sqrt(reserveA * reserveB);
    }
}

